INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 106001, 1, 0, "2030/12/17 14:59:59", "キャル", 0.0, 7, "2015/12/17 15:00:00", 0, 7001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 105901, 1, 0, "2030/12/17 14:59:59", "コッコロ", 0.0, 7, "2015/12/17 15:00:00", 0, 7002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 105801, 1, 0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 7, "2015/12/17 15:00:00", 0, 7003);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 106001, 1, 0, "2030/12/17 14:59:59", "キャル", 0.0, 10, "2015/12/17 15:00:00", 0, 10001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 105901, 1, 0, "2030/12/17 14:59:59", "コッコロ", 0.0, 10, "2015/12/17 15:00:00", 0, 10002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 105801, 1, 0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 10, "2015/12/17 15:00:00", 0, 10003);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -416.5, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 105801, 1, 0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 12, "2015/12/17 15:00:00", 0, 12001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 106001, 1, 0, "2030/12/17 14:59:59", "キャル", 0.0, 13, "2015/12/17 15:00:00", 0, 13001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 105901, 1, 0, "2030/12/17 14:59:59", "コッコロ", 0.0, 13, "2015/12/17 15:00:00", 0, 13002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 105801, 1, 0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 13, "2015/12/17 15:00:00", 0, 13003);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 106001, 1, 0, "2030/12/17 14:59:59", "キャル", 0.0, 14, "2015/12/17 15:00:00", 0, 14001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 105901, 1, 0, "2030/12/17 14:59:59", "コッコロ", 0.0, 14, "2015/12/17 15:00:00", 0, 14002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 105801, 1, 0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 14, "2015/12/17 15:00:00", 0, 14003);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -470.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 105901, 1, 0, "2030/12/17 14:59:59", "コッコロ", 0.0, 15, "2015/12/17 15:00:00", 0, 15001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 106001, 1, 0, "2030/12/17 14:59:59", "キャル", 0.0, 16, "2015/12/17 15:00:00", 0, 16001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 105901, 1, 0, "2030/12/17 14:59:59", "コッコロ", 0.0, 16, "2015/12/17 15:00:00", 0, 16002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 105801, 1, 0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 16, "2015/12/17 15:00:00", 0, 16003);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 105901, 1, 0, "2030/12/17 14:59:59", "コッコロ", 0.0, 17, "2015/12/17 15:00:00", 0, 17002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 106001, 1, 0, "2030/12/17 14:59:59", "キャル", 0.0, 25, "2015/12/17 15:00:00", 0, 17004);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 105901, 1, 0, "2030/12/17 14:59:59", "コッコロ", 0.0, 25, "2015/12/17 15:00:00", 0, 17005);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 105801, 1, 0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 25, "2015/12/17 15:00:00", 0, 17006);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 190801, 1, 0, "2030/12/17 14:59:59", "カリン", 0.0, 18, "2015/12/17 15:00:00", 0, 18001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 2, 1, -363.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 190801, 1, 0, "2030/12/17 14:59:59", "カリン", 0.0, 18, "2015/12/17 15:00:00", 0, 18002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 3, 1, -470.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 190801, 1, 0, "2030/12/17 14:59:59", "カリン", 0.0, 19, "2015/12/17 15:00:00", 0, 19001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 4, 1, -470.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 190801, 1, 0, "2030/12/17 14:59:59", "カリン", 0.0, 19, "2015/12/17 15:00:00", 0, 19002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 5, 1, -470.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 190801, 1, 0, "2030/12/17 14:59:59", "カリン", 0.0, 20, "2015/12/17 15:00:00", 0, 20001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 6, 1, -470.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 190801, 1, 0, "2030/12/17 14:59:59", "カリン", 0.0, 20, "2015/12/17 15:00:00", 0, 20002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 106001, 1, 0, "2030/12/17 14:59:59", "キャル", 0.0, 21, "2015/12/17 15:00:00", 0, 21001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 105901, 1, 0, "2030/12/17 14:59:59", "コッコロ", 0.0, 21, "2015/12/17 15:00:00", 0, 21002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 105801, 1, 0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 21, "2015/12/17 15:00:00", 0, 21003);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -430.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 190801, 1, 0, "2030/12/17 14:59:59", "カリン", 0.0, 22, "2015/12/17 15:00:00", 0, 22001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 2, 1, -430.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 190801, 1, 0, "2030/12/17 14:59:59", "カリン", 0.0, 22, "2015/12/17 15:00:00", 0, 22002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 3, 1, -430.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 190801, 1, 0, "2030/12/17 14:59:59", "カリン", 0.0, 23, "2015/12/17 15:00:00", 0, 23001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 4, 1, -430.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 190801, 1, 0, "2030/12/17 14:59:59", "カリン", 0.0, 23, "2015/12/17 15:00:00", 0, 23002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (8.0, 1, 2, -385.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 109001, 1, 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 4.08, 24, "2019/01/31 12:00:00", 0, 24001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (8.0, 2, 2, -385.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 109001, 1, 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 5.0, 24, "2019/01/31 12:00:00", 0, 24002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (8.0, 3, 2, -385.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 109001, 1, 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10.11, 24, "2019/01/31 12:00:00", 0, 24003);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (8.0, 4, 2, -385.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 109001, 1, 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 4.0, 24, "2019/01/31 12:00:00", 0, 24004);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (8.0, 5, 2, -385.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 109001, 1, 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 6.0, 24, "2019/01/31 12:00:00", 0, 24005);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 6, 1, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 109002, 1, 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 24, "2019/01/31 12:00:00", 0, 24006);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 7, 1, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 109002, 1, 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 24, "2019/01/31 12:00:00", 0, 24007);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 8, 1, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 109002, 1, 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 24, "2019/01/31 12:00:00", 0, 24008);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 9, 1, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 109002, 1, 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 24, "2019/01/31 12:00:00", 0, 24009);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 10, 1, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 109002, 1, 10011, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 24, "2019/01/31 12:00:00", 0, 24010);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (8.0, 1, 2, -385.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 109101, 1, 10011, "2030/12/17 14:59:59", "シズル（バレンタイン）", 2.12, 24, "2019/01/31 12:00:00", 0, 24011);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (8.0, 2, 2, -385.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 109101, 5, 10011, "2030/12/17 14:59:59", "シズル（バレンタイン）", 4.19, 24, "2019/01/31 12:00:00", 0, 24012);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (8.0, 3, 4, -385.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 109101, 2, 10011, "2030/12/17 14:59:59", "シズル（バレンタイン）", 2.3, 24, "2019/01/31 12:00:00", 0, 24013);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 4, 1, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 109102, 1, 10011, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 24, "2019/01/31 12:00:00", 0, 24014);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (8.0, 5, 2, -385.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 109101, 5, 10011, "2030/12/17 14:59:59", "シズル（バレンタイン）", 5.23, 24, "2019/01/31 12:00:00", 0, 24015);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 6, 1, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 109102, 1, 10011, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 24, "2019/01/31 12:00:00", 0, 24016);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (8.0, 7, 2, -385.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 109101, 1, 10011, "2030/12/17 14:59:59", "シズル（バレンタイン）", 5.01, 24, "2019/01/31 12:00:00", 0, 24017);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 8, 1, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 109102, 1, 10011, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 24, "2019/01/31 12:00:00", 0, 24018);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 9, 1, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 109102, 1, 10011, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 24, "2019/01/31 12:00:00", 0, 24019);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 10, 1, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 109102, 1, 10011, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 24, "2019/01/31 12:00:00", 0, 24020);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 106001, 1, 0, "2030/12/17 14:59:59", "キャル", 0.0, 26, "2015/12/17 15:00:00", 0, 26001);
