INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 105801, 1, 0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 43, "2015/12/17 15:00:00", 0, 43001);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 105901, 1, 0, "2030/12/17 14:59:59", "コッコロ", 0.0, 43, "2015/12/17 15:00:00", 0, 43002);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -363.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 106001, 1, 0, "2030/12/17 14:59:59", "キャル", 0.0, 43, "2015/12/17 15:00:00", 0, 43003);
INSERT INTO `v1_641b9cb34bef9aba762a6aef1dd1c107572f17b56187182940ba85b08345ca5a` VALUES (0.0, 1, 1, -416.5, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 123001, 1, 0, "2030/12/17 14:59:59", "アメス", 0.0, 44, "2015/12/17 15:00:00", 0, 43004);
